message:
OBDE QUEREN CHEGAR AGORA ???? 
OUTRO GOLPE ????? O QUE PODERIA ACONTECER ? 
@DrMarcelofrazao

Relatório FFAA Confirma: Não Há Lisura no PROCESSO ELEITORAL

10 NOV 2022

Não é um problema desta eleição...
É um problema do processo eleitoral inteiro:

1 - Sem acesso ao código-fonte;
2 - Sem garantias de que o código-objeto veio do código-fonte;
3 - 17 milhões de linhas de código para serem avaliadas em poucos dias (e nem ocorreu por causa do impedimento ao acesso);
4 - Inexistência de explicação do que motivou um código tão pesado para um procedimento tão simples;
5 - Não há transparência em nenhuma parte do processo;
6 - Não há garantias de segurança no processo;
7 - Não é possível auditar todo o processo.

Frente a isto, as medidas:

1 - Anulação do pleito;
2 - Apuração dos responsáveis;
3 - Apuração dos beneficiados com a situação;
4 - Correção do processo eleitoral com total substituição;
5 - Indenizações aos prejudicados em todas as escalas e ordens;
6 - Indenizações ao erário público.
